import React from "react";
import Navbar from "../Components/Navbar";
import Products from "../Components/Products";
import PageBanner from "../Components/PageBanner";

const Collections = () => {
  return (
    <>
      <Navbar />
      <PageBanner 
        title="Collections"
      />
      <Products />
    </>
  );
};

export default Collections;
